import React from 'react';
import { Form, Input, Button, Select } from 'antd';

const layout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 16 },
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 },
};

const Join = () => {
  const onFinish = (values) => {
    console.log('Success:', values);
  };

  const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };
  return (
    <div style={{ backgroundColor: '#272727', height: '800px' }}>
      <div style={{ backgroundColor: 'white', width: '400px', height: '500px', position: 'absolute', top: '20%', left: '38%', padding: '10px' }}>
        <Form {...layout} name="join" initialValues={{ remember: true }} onFinish={onFinish} onFinishFailed={onFinishFailed}>
          <Form.Item label="Username" name="username" rules={[{ required: true, message: 'Please input your username!' }]}>
            <Input />
          </Form.Item>
          <Form.Item label="Password" name="password" rules={[{ required: true, message: 'Please input your password!' }]}>
            <Input.Password />
          </Form.Item>
          <Form.Item label="Select">
            <Select placeholder="소속대학을 선택해 주세요">
              <Select.Option value="software">소프트웨어대학</Select.Option>
              <Select.Option value="engineering">공과대학</Select.Option>
              <Select.Option value="media">언론정보대학</Select.Option>
              <Select.Option value="economic">경상대학</Select.Option>
              <Select.Option value="science">과학기술융합대학</Select.Option>
              <Select.Option value="design">디자인대학</Select.Option>
              <Select.Option value="culture">국제문화대학</Select.Option>
              <Select.Option value="sport">예체능대학</Select.Option>
              <Select.Option value="pharmacy">약학대학</Select.Option>

            </Select>
          </Form.Item>
          <Form.Item {...tailLayout}>
            <Button type="primary" htmlType="submit">
              가입하기
            </Button>
          </Form.Item>
        </Form>
      </div>
    </div>
  );
};

export default Join;
